def _is_pow2(n):
    return (n & (n - 1) == 0) and (n > 0)


def _get_hadK(n, transpose=False):
    hadK, K = None, None
    if n % 172 == 0:  # llama-2-7b up
        assert _is_pow2(n // 172)

        K = 172
        hadK = _get_had172().T if transpose else _get_had172()
    elif n % 156 == 0:  # llama-1-30b 3x hidden
        assert _is_pow2(n // 156)

        K = 156
        hadK = get_had156().T if transpose else get_had156()
    elif n % 140 == 0:  # llama-1-30b intermediate
        assert _is_pow2(n // 140)

        K = 140
        hadK = get_had140().T if transpose else get_had140()
    elif n % 108 == 0:  # llama-1-13b intermediate
        assert _is_pow2(n // 108)

        K = 108
        hadK = get_had108().T if transpose else get_had108()
    elif n % 60 == 0:  # llama-1-13b 3x hidden
        assert _is_pow2(n // 60)

        K = 60
        hadK = get_had60().T if transpose else get_had60()
    elif n % 52 == 0:  # llama-1-13b 1x hidden
        assert _is_pow2(n // 52)

        K = 52
        hadK = get_had52().T if transpose else get_had52()
    elif n % 36 == 0:
        assert _is_pow2(n // 36)

        K = 36
        hadK = get_had36().T if transpose else get_had36()
    elif n % 28 == 0:
        assert _is_pow2(n // 28)

        K = 28
        hadK = get_had28().T if transpose else get_had28()
    elif n % 44 == 0:
        assert _is_pow2(n // 44)

        K = 44
        hadK = get_had44().T if transpose else get_had44()
    elif n % 40 == 0:
        assert _is_pow2(n // 40)

        K = 40
        hadK = get_had40().T if transpose else get_had40()
    elif n % 20 == 0:
        assert _is_pow2(n // 20)

        K = 20
        hadK = get_had20().T if transpose else get_had20()
    elif n % 12 == 0:
        assert _is_pow2(n // 12)

        K = 12
        hadK = get_had12().T if transpose else get_had12()
    else:
        assert _is_pow2(n)

        K = 1

    return hadK, K


def _matmul_hadU_cuda(X, hadK, K):
    n = X.shape[-1]
    if K == 1:
        return HadamardTransform.apply(X.contiguous()) / torch.tensor(n).sqrt()
    # if transpose:
    #     hadK = hadK.T.contiguous()
    input = X.view(-1, K, n // K)
    input = HadamardTransform.apply(input.contiguous()) / torch.tensor(n).sqrt()
    input = hadK.to(input.device).to(input.dtype) @ input
    return input.reshape(X.shape)


def _hadamard_matrix(size, device):
    # See https://cornell-relaxml.github.io/quip-sharp/ , Section "Randomized Hadamard Transformation"
    Q = torch.eye(size)
    return _matmul_hadU(Q).to(device)


def _apply_exact_had_to_linear(module, had_dim=-1, output=False, R2=None):
    assert isinstance(module, torch.nn.Linear)
    in_features, out_features = module.in_features, module.out_features

    if had_dim != -1:
        assert _is_pow2(had_dim), "Hadamard dimension must be a power of 2!"

    W_ = module.weight.data
    dtype = W_.dtype
    dev = W_.device
    init_shape = W_.shape
    W_ = W_.float().cuda()

    if had_dim == -1:
        if output:
            had_K, K = _get_hadK(out_features)
            W_ = _matmul_hadU_cuda(W_.t(), had_K, K).t()
        if not output:
            had_K, K = _get_hadK(in_features)
            W_ = _matmul_hadU_cuda(W_, had_K, K)
    else:
        hadK = _hadamard_matrix(had_dim, "cuda").to(torch.float64)  # TODO: do not calculate if not used
        if R2 is not None:
            hadK = R2.to(torch.float64)
        if output:
            W_ = W_.t()
            transposed_shape = W_.shape
            temp = W_.reshape(-1, transposed_shape[-1] // had_dim, had_dim)
            temp = temp.to(torch.float64) @ hadK
            W_ = temp.reshape(transposed_shape).t()
        else:
            init_shape = W_.shape
            temp = W_.reshape(-1, init_shape[-1] // had_dim, had_dim)
            temp = temp.to(torch.float64) @ hadK
            W_ = temp.reshape(init_shape)
    module.weight.data = W_.to(device=dev, dtype=dtype)


def _matmul_hadU(X, transpose=False):
    n = X.shape[-1]
    hadK, K = _get_hadK(n, transpose)
    input = X.clone().view(-1, n, 1)
    output = input.clone()
    while input.shape[1] > K:
        input = input.view(input.shape[0], input.shape[1] // 2, 2, input.shape[2])
        output = output.view(input.shape)
        output[:, :, 0, :] = input[:, :, 0, :] + input[:, :, 1, :]
        output[:, :, 1, :] = input[:, :, 0, :] - input[:, :, 1, :]
        output = output.view(input.shape[0], input.shape[1], -1)
        (input, output) = (output, input)
    del output

    if K > 1:
        # Do not explicitly repeat - OOM
        # input = torch.bmm(
        #     hadK.repeat(len(input), 1, 1).to(input.device).to(input.dtype), input)
        # Use bcast instead
        input = hadK.view(1, K, K).to(input) @ input

    return input.view(X.shape) / torch.tensor(n).sqrt()


def _random_hadamard_matrix(size, device):
    # See https://cornell-relaxml.github.io/quip-sharp/ , Section "Randomized Hadamard Transformation"
    Q = torch.randint(low=0, high=2, size=(size,)).to(torch.float64)
    Q = Q * 2 - 1
    Q = torch.diag(Q)
    return _matmul_hadU(Q).to(device)


def apply_spinquant_to_llama(model):
    """
    Apply SpinQuant to Llama: https://arxiv.org/abs/2405.16406
    
    Currently, this only applies the R2 rotation matrices to the model.
    """
    from torchao._models.llama.model import Attention

    torch.manual_seed(0)
    R2 = _random_hadamard_matrix(model.config.head_dim, "cuda")
    
    # Apply R2 rotation to all multi-head self-attention modules
    for m in model.modules():
        if isinstance(m, Attention):
            assert isinstance(m.wqkv, nn.Linear)
            assert isinstance(m.wo, nn.Linear)

            head_dim = model.config.head_dim

            # Rotate W_o
            _apply_exact_had_to_linear(m.wo, had_dim=head_dim, output=False, R2=R2)

            # Extract W_v
            kv_size = model.config.n_local_heads * head_dim
            wq, wk, wv = m.wqkv.weight.data.split([model.config.dim, kv_size, kv_size], dim=0)
            out_features, in_features = wv.shape
            wv_mod = nn.Linear(in_features, out_features, bias=False, device=wq.device, dtype=wq.dtype)
            wv_mod.weight.data = wv

            # Rotate W_v
            _apply_exact_had_to_linear(wv_mod, had_dim=head_dim, output=True, R2=R2)

            m.wqkv.weight.data = torch.cat([wq, wk, wv_mod.weight.data], dim=0)
